import React from 'react';
import classes from './HeaderContent.module.css';


function HeaderContent({ patientName, clientCode }) {
    return (
        <div className={classes.headerContent}>
            <div className={classes.patientInfo}>
                <div className={classes.patientName}>{patientName}</div>
                <div className={classes.clientCode}>Client Code: {clientCode}</div>
            </div>
        </div>
    );
}

export default HeaderContent;
